import React from "react";
import axios from 'axios';
import "./styles.css";
import SearchCountry from "./atoms/SearchCountry/SearchCountry.js"
import Converter from "./atoms/Converter/Converter.js"

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      searchText: "",
      country: [],
      searchError: ""
    };
  }
  

  render() {
    return (
      <div className="container">
        <Converter />
        <SearchCountry />
      </div >

    );
  }
}
export default App;
